INSERT INTO `clinics` VALUES (1,'Woodridge Vet Surgery','We are a local veterinary clinic providing the best care and services for your pets. Come and meet the team today!','Woodridge Vet Surgery strives to be the best vet hospital. We service Woodridge and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@woodridgevet.com.au','(07) 3209 4242','','Woodridge','Shop 8/91 Ewing Road','4114','QLD',36,'-27.6325612','153.1091419','https://www.jstvet.com.au/book-now/','http://www.woodridgevet.com.au','{\"facebook\":\"https:\\/\\/www.facebook.com\\/woodridgevet\\/\"}','{\"friday-to\": \"17:30\", \"monday-to\": \"17:30\", \"sunday-to\": null, \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": null, \"tuesday-to\": \"17:30\", \"friday-from\": \"08:30\", \"monday-from\": \"08:30\", \"saturday-to\": \"12:00\", \"sunday-from\": null, \"thursday-to\": \"17:30\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": null, \"thursday-to2\": \"00:00\", \"tuesday-from\": \"08:30\", \"wednesday-to\": \"17:30\", \"saturday-from\": \"09:00\", \"thursday-from\": \"08:30\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"08:30\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'woodridge_vet_surgery.png','woodridge_vet_surgery.png','Australia/Brisbane',NULL,'0000-00-00 00:00:00','2019-05-16 02:54:00'),(2,'Winston Hills Vet Hospital','Our Veterinary Hospital provides modern, professional and affordable health care for your pets. We have been providing excellence in care for pets and their owners from our hospitals for over 24 years. Our aim is to make your pet feel at ease in our clinic with a caring and gentle approach to treatment and consultations. Our dedicated staff and leading veterinarians are all passionate about pets and are avid animal lovers.\r\n\r\nOur vets have over eighty years of experience in treating dogs and cats, as well as a wide range of animals. We consult with each other on the more challenging cases, and happily rely on each others skills to ensure the best possible care for your pets. We all really enjoy coming to work each day, so our hospitals are a happy environment in which your pets, and you, will feel at ease. Our friendly vets and nurses aim to make your visit a truly pleasant experience.\r\nAt our Veterinary Hospital, you?ll receive sound advice. Well provide you with a clear explanation of the relevant health care issues and treatment options. We know that you want to understand what is wrong with your pet in easy to comprehend language. We will get to the bottom of the problem, but not baffle you with science! With good advice and professional recommendations, you?ll be well equipped to make the best decisions for your pet.\r\n\r\nWe give back to the community and to animals that cannot care for themselves. We have been providing pro bono wildlife care for nearly 25 years - sometimes to 3 or more animals a day, supporting WIRES and Sydney Metropolitan Wildlife Service. We rehome many animals. Each of us has at least one rescue animal (Gordon and Helen have seven!)','Winston Hills Vet Hospital strives to be the best vet clinic. We service Winston Hills and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@glenhavenvet.com.au','(02) 9624 4111','02 9639-7744','Winston Hills','195 Caroline Chisholm Drive','2153','NSW',36,'-33.7731781','150.9679866','https://www.winstonhillsvet.com.au/contact-us.aspx','http://www.winstonhillsvet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/gwhvh\\/\"}','{\"friday-to\": \"19:00\", \"monday-to\": \"19:00\", \"sunday-to\": null, \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": null, \"tuesday-to\": \"19:00\", \"friday-from\": \"08:00\", \"monday-from\": \"08:00\", \"saturday-to\": \"12:00\", \"sunday-from\": null, \"thursday-to\": \"19:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"18:00\", \"sunday-from2\": null, \"thursday-to2\": \"00:00\", \"tuesday-from\": \"08:00\", \"wednesday-to\": \"19:00\", \"saturday-from\": \"08:00\", \"thursday-from\": \"08:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"15:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"08:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'winston_hills_vet_hospital.png','winston_hills_vet_hospital.png','Australia/Sydney',NULL,'0000-00-00 00:00:00','2019-05-16 02:55:04'),(3,'Vineyard Veterinary Hospital','Vineyard Veterinary Hospital is a modern small animal veterinary hospital providing the highest level of veterinary care to our animal patients in the Hawkesbury, Hills area and beyond.\r\n\r\nWe are an A-class veterinary hospital, which is well equipped with quality facilities and vast range of services. This, along with our experienced, dedicated staff allows us to achieve the reputation that is well known throughout the area.','Vineyard Veterinary Hospital strives to be the best vet clinic. We service Vineyard and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@vineyardvet.com.au','(02) 9627 1257','0488 404 047','Vineyard','703 Windsor Rd','2765','NSW',36,'-33.6543799','150.8723564','http://www.vineyardvet.com.au/contact/','http://www.vineyardvet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/VineyardVeterinaryHospital\\/\"}','{\"friday-to\": \"12:00\", \"monday-to\": \"12:00\", \"sunday-to\": \"12:00\", \"friday-to2\": \"18:00\", \"monday-to2\": \"18:00\", \"sunday-to2\": \"00:00\", \"tuesday-to\": \"12:00\", \"friday-from\": \"08:30\", \"monday-from\": \"08:30\", \"saturday-to\": \"13:30\", \"sunday-from\": \"09:00\", \"thursday-to\": \"12:00\", \"tuesday-to2\": \"18:00\", \"friday-from2\": \"16:00\", \"monday-from2\": \"16:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": \"00:00\", \"thursday-to2\": \"18:00\", \"tuesday-from\": \"08:30\", \"wednesday-to\": \"12:00\", \"saturday-from\": \"09:00\", \"thursday-from\": \"08:30\", \"tuesday-from2\": \"16:00\", \"wednesday-to2\": \"18:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"16:00\", \"wednesday-from\": \"08:30\", \"wednesday-from2\": \"16:00\"}',0,0,1,1,'vineyard_veterinary_hospital.png','vineyard_veterinary_hospital.png','Australia/Sydney',NULL,'0000-00-00 00:00:00','2019-05-16 03:04:39'),(4,'Vetwest Yokine','Vetwest Yokine is situated at 162 Wanneroo Road, Yokine 6060. We are on the corner of Royal Street and accessible by the main roads of Morley drive, Walcott Street, Charles Street and Green Street. Right next to a pharmacy, our drive in centre has ample parking and some green lawn and garden for your pet to sniff or meander through as need be. At just 10km from Perth CBD, Vetwest Yokine is our closest north based clinic to Perth and our nearest train station is Glendalough, which is only 3.7km away from our location. We are also situated a quick 3 minute drive from the long standing Dog Swamp Shopping Centre which means that convenient amenities such as fresh bones or mince for your pet are just a stone?s throw away from us! We are proud community members of Yokine and its surrounding suburbs of Nollamara, Tuart Hill, Joondanna, Glendalough, Mt Hawthorn, Coolbinia, Menora, Inglewood, Bedford, Dianella, Noranda, Mirrabooka, Balga, Balcatta and Stirling.\r\n\r\nYou might not know this but ?Yokine? is derived from the Australian Aboriginal word for dingo or ?native dog? which we think is very fitting for our clinic and our love of canines! We don?t just look after our dog friends though; we will see most furry, feathered and scaled animals. If you aren?t sure about if you can bring your pet in then just give us a call!','Vetwest Yokine strives to be the best vet hospital. We service Yokine and surrounding suburbs 