'Pacific/Auckland',NULL,'0000-00-00 00:00:00','2019-05-16 03:15:57'),(48,'Ourimbah Veterinary Hospital','Best Care for Pets and People.... at Ourimbah Veterinary Hospital our aim is to provide you and your pet with the highest quality in veterinary medicine and surgery.\r\n\r\nWe want you to feel welcome each and every time you speak with or visit us. We want your pet to enjoy their visit and eagerly return. We will strive to attain this with our gentle methods using positive reinforcement techniques only. Our team is our most valuable resource in our service commitment to you. Communication is key to great service and we will always listen to your concerns and ensure you are fully informed at every step. \r\n\r\nWe advocate preventative health for longevity and quality of life, and provide treatment options when prevention is not enough. We are dedicated to caring for your pet from birth to old age and have a wide range of experience with both small and large animals.\r\n\r\nOurimbah Veterinary Hospital was established in 1982 as a one-vet operation.  In 1992 we moved into our current premises, a purpose-built small animal and horse hospital. Over the past three decades we have grown substantially and now have 5 full time and two part time vets with about 10 support staff. We are one of the only truly mixed veterinary hospitals on the Central Coast and look after all types of animals large and small including dogs, cats, birds, rabbits and guinea pigs, wildlife of all kinds, horses, cattle, sheep, goats and alpacas. \r\n\r\nOur hospital is fully equipped with both small animal and equine surgical theatres, x-ray and ultrasound facilities, dental facilities, in-hospital diagnostic laboratory, separate dog and cat wards, isolation ward and much more. We offer a large range of surgical services which include orthopaedics and soft tissue surgery, as well as routine procedures such as desexing.','Ourimbah Veterinary Hospital strives to be the best vet clinic. We service Ourimbah and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@ourimbahvet.com.au','(02) 4362 1644','','Ourimbah','10 Pacific Hwy','2258','NSW',36,'-33.3632662','151.3714699','http://www.ourimbahvet.com.au/OnlineBooking/tabid/2810/Default.aspx','http://www.ourimbahvet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/ourimbahvet\\/\"}','{\"friday-to\": \"19:00\", \"monday-to\": \"19:00\", \"sunday-to\": \"11:00\", \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": \"00:00\", \"tuesday-to\": \"19:00\", \"friday-from\": \"08:30\", \"monday-from\": \"08:30\", \"saturday-to\": \"13:00\", \"sunday-from\": \"09:00\", \"thursday-to\": \"19:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": \"00:00\", \"thursday-to2\": \"00:00\", \"tuesday-from\": \"08:30\", \"wednesday-to\": \"19:00\", \"saturday-from\": \"08:30\", \"thursday-from\": \"08:30\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"08:30\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'ourimbah_veterinary_hospital.png','ourimbah_veterinary_hospital.png','Australia/Sydney',NULL,'0000-00-00 00:00:00','2019-05-16 03:16:05'),(49,'Northgate Veterinary Hospital','Vets4Pets was founded in 1972 and has grown to provide a wide range of small animal veterinary care in Adelaide, through its seven convenient locations in Adelaides Northern suburbs including the new Vets4Pets Dernancourt Veterinary Centre.\r\n\r\nEvery Vets4Pets local practice offers professional facilities, modern equipment and highly trained people who love animals. We believe in offering the very best in general veterinary care.\r\n\r\nA senior vet will oversee the case management and treatment of your pet for as long as you remain our client. Should your pet need a specific service (such as ultrasound, orthopaed