g with outstanding customer service to their human companions.\r\n\r\nOur highest priority is the safety and comfort of your pet when undergoing any procedure.  Of course, every anaesthetic and surgical procedure carries some degree of risk.  It is our aim to ensure that you, as an owner, are completely aware of the procedure being undertaken and any associated risks, and are kept completely informed from start to finish.\r\n\r\nIn order to reduce the risk of complications associated with any sedation or anaesthetic, your veterinary surgeon will perform a thorough clinical examination and evaluation of your pet.  Unfortunately, it is not possible to eliminate all of the possible complications that may arise.  To minimalise potential risks, we offer a full range of services.\r\n\r\nOur Services\r\n\r\nWith a vast wealth of knowledge and experience, our veterinarians and nursing staff pride themselves on providing the highest standard of veterinary care.  Our hospital is equipped with an extensive array of equipment to help us efficiently diagnose and treat all medical and surgical cases.\r\n\r\nThis includes:\r\n\r\nModern digital x-ray developer\r\nState of the art orthopaedic equipment\r\nIn-house diagnostic laboratory equipment\r\nSurgical microscope\r\nPhacoemulsifier for cataract surgery\r\nAdvanced anaesthetic monitoring machines and brand new dental machine\r\nHeated surgery tables and ?bear hugger? to keep our patients warm under anaesthesia\r\nIntensive care hospitalisation and isolation wards\r\nBrand new stainless steel kennels\r\nExtensive in-hospital pharmacy\r\n\r\nPayment\r\n\r\nWherever possible, an estimate of costs is always provided to our clients prior to procedures being performed.  However, the may vary due to unforeseen circumstances.\r\n\r\nAll accounts are payable at the time of discharge.  We accept cash, ETPOS and VISA/Mastercard payments.  The hospital also uses VetPay to assist clients who are experiencing financial difficulty.\r\n\r\nOur hospital receives no financial support for the Government or any charitable institutions, so prompt payment of fees enables us to continue providing our clients with the very best veterinary care.','Greenfields Vet Hospital strives to be the best vet clinic. We service Greenfields and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@greenfieldsvet.com.au','(08) 9581 7766','(08) 9412 5700','Greenfields','4/39 Gordon Rd','6210','WA',36,'-32.5114233','115.7454309','https://greenfieldsvet.com.au/contact-us/','https://greenfieldsvet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetsmandurah6210\\/\"}','{\"friday-to\": \"18:00\", \"monday-to\": \"18:00\", \"sunday-to\": \"17:00\", \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": \"00:00\", \"tuesday-to\": \"18:00\", \"friday-from\": \"07:00\", \"monday-from\": \"07:00\", \"saturday-to\": \"15:00\", \"sunday-from\": \"08:00\", \"thursday-to\": \"18:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": \"00:00\", \"thursday-to2\": \"00:00\", \"tuesday-from\": \"07:00\", \"wednesday-to\": \"18:00\", \"saturday-from\": \"07:00\", \"thursday-from\": \"07:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"07:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'greenfields_vet_hospital.png','greenfields_vet_hospital.png','Australia/Perth',NULL,'0000-00-00 00:00:00','2019-05-16 03:19:43'),(71,'Golden Grove Emergency Hospital','Looking for a Golden Grove Vet?\r\nIf you are looking for a vet in Tea Tree Gully or Newton, the Golden Grove vet team is happy to cater to your needs. We provide 24 hour treatment and supervision of all our veterinary hospital patients and can handle even the most demanding treatments.\r\n\r\nVets4Pets Emergency Veterinary Hospital is open 24 hours a day, 7