ent location in Brisbanes inner North since 1965.\r\n\r\nThe practice principals, Calum and Joanne Robertson, graduated together from the University of Queensland in 1986. They first worked in small animal clinics in Sydney until 1989. A 3 year stint locuming throughout the United Kingdom then saw them return to Brisbane in 1992.\r\n\r\nCalum and Joanne bought the Clayfield Veterinary Clinic in February 2001 and, since this time, have been committed to building a practice that focuses on providing high quality and compassionate care for its patients and a welcoming and accessible environment for their human friends.\r\n\r\nOur Veterinary staff have a combined working experience of over 100 years in small animal general practice, enabling us to offer sound and sensible advice. We also pride ourselves on the fact that, if your pet is sick or injured, we are never Fully Booked : if we are open, your animal will be seen.\r\n\r\nWe are situated easily accessible to Eagle Junction, Hendra, Clayfield, Ascot, Hamilton and any of the inner Northern suburbs.','Clayfield Veterinary Clinic strives to be the best vet hospital. We service Clayfield and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@clayfieldvet.com.au','(07) 3262 1988','07 3262 1988','Clayfield','743 Sandgate Road','4011','QLD',36,'-27.4181637','153.0561297','http://www.clayfieldvet.com.au/ContactUs.aspx','http://www.clayfieldvet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/Clayfield-Veterinary-Clinic-188204397899499\\/\"}','{\"friday-to\": \"19:00\", \"monday-to\": \"19:00\", \"sunday-to\": null, \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": null, \"tuesday-to\": \"19:00\", \"friday-from\": \"07:30\", \"monday-from\": \"07:30\", \"saturday-to\": \"13:00\", \"sunday-from\": null, \"thursday-to\": \"19:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2