g wards, an x-ray room, surgery prep-room, surgery and isolation wards.\r\n\r\nThe beautiful surgery gardens have also been well tended, with several Carnival of Flowers awards as well as competition prizes for our giant Jacaranda tree and lovely Xanthorrhoea. We are also well known for our fragrant rose gardens and our roof displays that are set up at Christmas and Easter each year.\r\n\r\nQuality service and a well-equipped surgery has given Herriot House Veterinary Surgery a reputation for caring treatment that is second to none.\r\n\r\nWe are open from 7:00am to 7:00pm on weekdays, 7:30am to 6:00pm on Saturday and 9:00am to 5:30pm on Sunday. Contact us on (07) 4639 2012.\r\n\r\nIf you require a vet outside our regular business hours or want to request a house call, you can contact us on the same number.','Herriot House Veterinary Surgery strives to be the best vet hospital. We service Toowoomba City and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','mail@herriothousevets.com.au','(07) 4639 1733','07 4639 1733','Toowoomba City','Cnr of 143 West and Herries Sts','4350','QLD',36,'-27.5627842','151.9425506','https://www.herriothousevets.com.au/contact-us/','http://www.herriothousevets.com.au','{\"facebook\":\"https:\\/\\/www.facebook.com\\/HerriotHouseVets\\/\"}','{\"friday-to\": \"19:30\", \"monday-to\": \"19:30\", \"sunday-to\": \"17:30\", \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": \"00:00\", \"tuesday-to\": \"00:00\", \"friday-from\": \"07:00\", \"monday-from\": \"07:00\", \"saturday-to\": \"18:00\", \"sunday-from\": \"08:30\", \"thursday-to\": \"21:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": \"00:00\", \"thursday-to2\": \"00:00\", \"tuesday-from\": \"00:00\", \"wednesday-to\": \"19:30\", \"saturday-from\": \"07:30\", \"thursday-from\": \"07:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"07:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'herriot_house_veterinary_surgery.png','herriot_house_veterinary_surgery.png','Australia/Brisbane',NULL,'0000-00-00 00:00:00','2019-05-16 03:25:05'),(103,'Animal Health Centre','Experienced Vets In Lower Hutt\r\nAnimal Health Centre is a Veterinary Clinic and Animal Hospital located in Lower Hutt. We provide top quality veterinary care in Lower Hutt City, the Hutt Valley and surrounding areas. \r\n\r\nWe offer a full-service medical and surgical facility and comprehensive veterinary care to Lower Hutts pets.\r\n\r\nFriendly Personal Service\r\nOur people are warm, personable and caring and we make a visit to the vet a positive experience. We get to know you and genuinely care about you and your pets.\r\n\r\nWe acknowledge that you are unique and we take time to find out who you are and what you need. We personalize our service to you by providing options that best fit your situation.\r\n\r\nUnderstanding Staff\r\nOur people all have pets so we understand the bond and concern when one of them is unwell. We do our best to help through clear explanations and providing options so you can choose the treatment plan that best suits your situation.\r\n\r\nExperienced Vets\r\nOur Veterinary Surgeons have each been qualified at least fifteen to twenty years, so you can rely on their extensive professional experience and expertise. Having more than one vet gives you choice and is also great when dealing with complex cases. If you like consistency we can also arrange for you to see the vet you prefer.\r\n\r\nDedicated Team\r\nOur people have a vested interest in providing quality personal service. We work on the philosophy that if you like what we do then you will come back, so we try to do the very best job we can for you and your fur family.\r\n\r\nPractice History\r\nAnimal Health Centre was opened by Dr Simon Nelson in February 2000.\r\n\r\nOur building was originally a Government Post Office which has been converted and modernized to meet the needs of a busy veterinary hospital.\r\n\r\nWe chose the location as being central and accessible, as well as having great parking for our clients.\r\n\r\nFrom a staff of two at the outset Animal Health Centre has grown to a team of nine today, including three vets, four vet nurses and our administration team.','Animal Health Centre strives to be the best vet hospital. We service Epuni, Lower Hutt and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@lowerhuttvet.co.nz','(04) 577 3717','04 577 3717','Epuni, Lower Hutt','109 Oxford Terrace','5011','NZ',554,'-41.2071198','174.9298765','https://lowerhuttvet.co.nz/contact-us/','https://lowerhuttvet.co.nz','[]','{\"friday-to\": \"18:30\", \"monday-to\": \"18:30\", \"sunday-to\": null, \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": null, \"tuesday-to\": \"18:30\", \"friday-from\": \"08:00\", \"monday-from\": \"08:00\", \"saturday-to\": \"12:00\", \"sunday-from\": null, \"thursday-to\": \"18:30\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": null, \"thursday-to2\": \"00:00\", \"tuesday-from\": \"08:00\", \"wednesday-to\": \"18:30\", \"saturday-from\": \"09:00\", \"thursday-from\": \"08:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"08:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'animal_health_centre.png','animal_health_centre.png','Pacific/Auckland',NULL,'0000-00-00 00:00:00','2019-05-16 03:25:19'),(104,'Canberra Equine Hospital','We hope the time you spend here with us is both enjoyable and educational, and that you gain as much practical equine veterinary work experience as possible. During this placement, you will be able to observe veterinary procedures and trea