57'),(107,'Orewa Beach Vet Clinic','Cathy Holgate first opened the Orewa Beach Veterinary Clinic in 2002.  Matthew Gumbrell joined her in 2007.  Our clinic is built on the principle that the number one priority is always the animals. Their comfort and care is paramount, and our intention is to treat them with the same level of care that we would show our own pets.\r\n\r\nWe firmly believe that an animal that is comfortable and unstressed is not only easier to handle and treat, but is also in a better physiological state for healing and recovery.\r\n\r\nAmong some of the things that our clinic boasts are\r\n\r\n&amp;amp;gt;sterile surgery suite for soft-tissue and orthopaedic surgeries\r\n&amp;amp;gt;in-house testing for common tests (such as urinalysis and bacterial culture)\r\n&amp;amp;gt;diagnostic xray and ultrasound facilities\r\n&amp;amp;gt;air conditioning\r\n&amp;amp;gt;separate (heated) hospital rooms for dogs and cats\r\n&amp;amp;gt;partitioned waiting areas so nervous pets don?t have to sit beside other pets\r\n&amp;amp;gt;active air extraction for areas that may have bad smells\r\n&amp;amp;gt;separate isolation ward for patients with infectious diseases\r\n&amp;amp;gt;blood pressure testing using doppler flow detector\r\n&amp;amp;gt;dentistry equipment including ultrasonic descaling and polishing\r\n&amp;amp;gt;wide range of high quality foods, including many therapeutic diets\r\n&amp;amp;gt;wide range of pet care products and flea control products with sound advice given\r\nWe are proud to service our local community ? caring for pets in the Orewa, Silverdale, Stillwater, Millwater,\r\nRed Beach, Whangaparaoa, &amp;amp; adjoining rural areas.','Orewa Beach Vet Clinic strives to be the best vet hospital. We service Orewa and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','obvc@xtra.co.nz','09 426 9950','09 443 5640','Orewa','39 Florence Avenue','931','NZ',554,'-36.585159','174.6925408','http://www.orewabeachvetclinic.