','better_pets.png','Australia/Brisbane',NULL,'0000-00-00 00:00:00','2019-05-16 03:27:18'),(114,'Caring Vets','Caring Vets was established in August 2006 by Dr Michael Wallace. Michael?s goal was to provide the Macarthur area with a friendly and professional vet care practice.\r\n\r\nWe are a predominantly small animal practice. Most of our patients are dogs, cats, rabbits and ferrets.\r\n\r\nCaring Vets have an up-to-date, fully equipped surgery. It is situated at 261 Camden Valley Way, Narellan, NSW, with ample off street parking. We are conveniently located within an easy drive from Narellan, Camden, Appin, Harrington Park, Oran Park, Currans Hill, Mount Annan, Elderslie, Gregory Hills and surrounds.\r\n\r\nCaring Vets are open 6 days a week for normal consultations. We are also available for Emergencies and Housecalls. If you require our Housecall service, please contact us to discuss.','Caring Vets strives to be the best vet hospital. We service Narellan and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','info@caringvets.com.au','(02) 4647 6321','','Narellan','261 Camden Valley Way','2567','NSW',36,'-34.0421998','150.7298107','http://caringvets.com.au/contact/','http://caringvets.com.au','{\"facebook\":\"https:\\/\\/www.facebook.com\\/Caring-Vets-143715069004654\\/\"}','{\"friday-to\": \"19:00\", \"monday-to\": \"19:00\", \"sunday-to\": null, \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": null, \"tuesday-to\": \"19:00\", \"friday-from\": \"09:00\", \"monday-from\": \"09:00\", \"saturday-to\": \"12:00\", \"sunday-from\": null, \"thursday-to\": \"19:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": null, \"thursday-to2\": \"00:00\", \"tuesday-from\": \"09:00\", \"wednesday-to\": \"19:00\", \"saturday-from\": \"09:00\", \"thursday-from\": \"09:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"09:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'caring_vets.png','caring_vets.png','Australia/Sydney',NULL,'0000-00-00 00:00:00','2019-05-16 03:27:51'),(115,'Toowoomba Veterinary Hospital','Toowoomba Veterinary Hospital has been providing quality veterinary care for the animals of Toowoomba for over 60 years and from our current site since 1998.\r\n\r\nWe believe pets are an important part of your family, and treat each animal we see as part of our own extended family.','Toowoomba Veterinary Hospital strives to be the best vet clinic. We service Toowoomba City and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','mail@toowoombavet.com.au','(07) 4632 8333','07 4632 8333','Toowoomba City','191 Hume Street','4350','QLD',36,'-27.5673314','151.9563939','https://www.toowoombavet.com.au/contact-us/','http://www.toowoombavet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/toowoombavethospital\\/\"}','{\"friday-to\": \"18:00\", \"monday-to\": \"18:00\", \"sunday-to\": \"16:00\", \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": \"00:00\", \"tuesday-to\": \"18:00\", \"friday-from\": \"08:00\", \"monday-from\": \"08:00\", \"saturday-to\": \"15:00\", \"sunday-from\": \"09:00\", \"thursday-to\": \"18:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": \"00:00\", \"thursday-to2\": \"00:00\", \"tuesday-from\": \"08:00\", \"wednesday-to\": \"18:00\", \"saturday-from\": \"08:00\", \"thursday-from\": \"08:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"08:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'toowoomba_veterinary_hospital.png','toowoomba_veterinary_hospital.png','Australia/Brisbane',NULL,'0000-00-00 00:00:00','2019-05-16 03:28:03'),(116,'Flemington Veterinary Hospital','Welcome to Flemington Veterinary Hospital\r\nFlemington Veterinary Clinic was purchased by Dr Anne Dynon in June 1989.\r\n\r\nThen a small clinic it provided health care for mainly dogs and cats. In 1995 the clinic was extensively renovated to become a purpose built veterinary centre. At this stage, a grooming service was introduced, employing a qualified groomer.\r\n\r\nIn 2002 the adjacent building was purchased and the second major renovation took place allowing us to upgrade the facilities to Hosptial Grade: extending consulting rooms, waiting rooms, car parking and introducing  our luxurious boutique cat hotel.  The Practice continues to grow and undergo evolution to provide advanced, quality, veterinary care.\r\n\r\nType of Practice\r\nFlemington Veterinary Hospital is a privately owned veterinary hospital located in Ascot Vale, Victoria.\r\n\r\nWe provide caring, quality veterinary advice, medicine, surgery and boarding for companion animals. Our hospital facilities are very similar to human hospitals including pathology facilities, an in house laboratory, an x ray suite, advanced anaesthetic monitoring and patient warming device in our surgical suite, ECG, and automatic intravenous fluid pumps for hospitalised animals. We have two visiting professional interest practitioners, allowing ultrasounds, endoscopy, oncology services and dermatology services to be performed in house and providing advice on more complex cases.\r\n\r\nThis allows us to provide a wide range of services from standard desexing to complex diagnostic investigations, advanced surgery or intensive medical care.\r\n\r\nFor more unusual cases we can refer to other specialists.\r\n\r\nWe are committed to delivering professional service and to assist you and your pets with the respect, kindness, level of care and expertise we would expect ourselves.\r\n\r\nPractice Ideal\r\nWe care for your pet as it was our own family member. \r\nWe attain to the highest ideals in patient care and customer service. \r\nWe strive to provide excellence in veterinary care, you can be assured of!','Flemington Veterinary Hospital strives to be the best vet clinic. We service Ascot Vale and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','care@flemingtonvet.com.au','(03) 9376 5299','','Ascot Vale','187 Mt Alexander Rd','3032','VIC',36,'-37.780752','144.9318696','http://www.flemingtonvet.com.au/ContactUs.aspx','http://www.flemingtonvet.com.au/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/flemingtonvet\\/\"}','{\"friday-to\": \"19:30\", \"monday-to\": \"19:30\", \"sunday-to\": \"13:00\", \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": \"00:00\", \"tuesday-to\": \"19:30\", \"friday-from\": \"07:00\", \"monday-from\": \"07:00\", \"saturday-to\": \"15:00\", \"sunday-from\": \"10:00\", \"thursday-to\": \"19:30\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": \"00:00\", \"thursday-to2\": \"00:00\", \"tuesday-from\": \"07:00\", \"wednesday-to\": \"19:30\", \"saturday-from\": \"08:30\", \"thursday-from\": \"07:00\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"07:00\", \"wednesday-from2\": \"00:00\"}',0,0,1,1,'flemington_veterinary_hospital.png','flemington_veterinary_hospital.png','Australia/Melbourne',NULL,'0000-00-00 00:00:00','2019-05-16 03:28:11'),(119,'Vetwest Armadale Byford','Vetwest Armadale Byford is located at 370 South Western Highway, Wungong WA 6112, in the South-East of Perths metropolitan area. We are located between Moore St and Mitchell St and conveniently located only 3.2 km south of Armadale Shopping Centre, 3.4km south of Armadale Train station and 5.1 km north of Byford train station. The City of Armadale has a thriving community spirit that Vetwest is proud to be a part of, not just in our own suburb of Wungong (located midway between Armadale and Byford) but also in the surrounding areas. We are proud to service the entire foothills area in the South-East of Perth including the local suburbs of Armadale, Byford, Wungong, Kelmscott, Mount Richon and beyond. Wungong, a name said to be of Australian Aboriginal descent is thought to mean embracing in local Nyungar language. At Vetwest Armadale-Byford, we think this name is a perfect fit for our location! \r\n\r\nOur hospital on South Western Highway can be easily spotted by the big blue Vetwest sign and banners on the roadside - you can?t miss us! Youll often see us promoting our popular free services such as free nail clipping, free dental checks or our special promotions that we run to help make caring for your pet more affordable. There is ample parking available and our beautiful gardens offer plenty of room for your dog to have a sniff and go to the toilet before and after their visit. We know you and your beloved pets will be comfortable from the minute you arrive at Vetwest Armadale-Byford.','Vetwest Armadale Byford strives to be the best vet hospital. We service Wungong and surrounding suburbs with open hours to suit you. Phone or search vet near me.','','','marketing@vetwest.com.au','08 9404 1170','08 9404 1111','Wungong','370 South Western Highway','6112','WA',36,'-32.1819009','116.0155974','https://www.clinicconnect.com.au/vetwest/','https://www.vetwest.com.au/about/locations/armadale-byford/','{\"facebook\":\"https:\\/\\/www.facebook.com\\/vetwest\\/\"}','{\"friday-to\": \"19:00\", \"monday-to\": \"19:00\", \"sunday-to\": null, \"friday-to2\": \"00:00\", \"monday-to2\": \"00:00\", \"sunday-to2\": null, \"tuesday-to\": \"19:00\", \"friday-from\": \"07:30\", \"monday-from\": \"07:30\", \"saturday-to\": \"17:00\", \"sunday-from\": null, \"thursday-to\": \"19:00\", \"tuesday-to2\": \"00:00\", \"friday-from2\": \"00:00\", \"monday-from2\": \"00:00\", \"saturday-to2\": \"00:00\", \"sunday-from2\": null, \"thursday-to2\": \"00:00\", \"tuesday-from\": \"07:30\", \"wednesday-to\": \"19:00\", \"saturday-from\": \"08:00\", \"thursday-from\": \"07:30\", \"tuesday-from2\": \"00:00\", \"wednesday-to2\": \"00:00\", \"saturday-from2\": \"00:00\", \"thursday-from2\": \"00:00\", \"wednesday-from\": \"07:30\", \"wednesday-from2\": \"00:00\"}',0,0,0,1,'vetwest_armadale_byford.png','vetwest_armadale_byford.png','Australia/Perth',NULL,'2018-10-26 06:47:11','2019-05-16 03:28:22'),(120,'Eastside Veterinary (Rose Bay)','Eastside Veterinary Emergency Specialists was established in order to provide around the clock animal care in the Eastern Suburbs of Sydney. Our Rose Bay Clinic is open during the day and our Rosebury clinic is 24hrs to ensure that you are able to access the best care for your pet irrespective of the time of day.\r\n\r\nIn addition to offering after hours emergency veterinary care, we offer a variety of specialist medical, surgical and dermatology appointments for animals during regular business hours. These are available Monday - Friday from 8:30am to 6pm.\r\n\r\nThe services we offer range from standard consultations and prescriptions through to medical imaging, pathology and surgery. We can also accommodate your animal during times of illness that require extended periods of hospitalisation.\r\n\r\nEastside Vets is a hospital that works closely with many local emergency animal hospitals in Sydney. We strive to complement these partner services and to be an extension of the care provided by your local family vet clinic.\r\n\r\nWe have veterinarians and nurses on site all day, every day. Our rotating roster of trained veterinary professionals ensure that there will always be someone available to provide the best care for your much loved pet.\r\n\r\nPlease keep in mind that our specialist vet services require a scheduled appointment and are only available during the above stated business hours.','Eastside Veterinary (Rose Bay) strives to be the best vet hospital. We s